import './App.css';
import './styles.css';
import Navbar from './Navbar';
import About from './Pages/About';
import Pricing from './Pages/Pricing';

function App() {
  let Component;

  switch (window.location.pathname) {
    case "/":
      Component = App;
      break;
    case "/pricing":
      Component = Pricing;
      break;
    case "/pricing":
      Component = About;
      break;
  }

  return (
    <Navbar></Navbar>
  );
}

export default App;
